import React from "react";
import stryled from "styled-components";

const PetsErrorContainer = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
`;

const ErrorImg = styled.img`
  width: 100%;
  max-width: 614px;
`;

export const PetsError = () => {
  return (
    <PetsErrorContainer>
      <ErrorImg src="./serverError.jpeg" alt="request error" />
    </PetsErrorContainer>
  );
};
